script: |
  super -f text -I q262.spq | sort > q262.out

inputs:
  - name: q262.spq
    data: |
      SELECT DISTINCT + + col1 AS col0 FROM tab1 (FORMAT parquet) WHERE + 86 / - col2 NOT IN ( - col1 + 7, + col1, + - CAST ( - + col1 AS INTEGER ) );
  - name: tab1

outputs:
  - name: q262.out
    data: |
      14
      47
      5
